ç\<?php exit; ?>a:1:{s:7:"content";O:8:"stdClass":23:{s:2:"ID";s:2:"10";s:11:"post_author";s:1:"2";s:9:"post_date";s:19:"2007-12-02 06:00:00";s:13:"post_date_gmt";s:19:"2007-12-02 06:00:00";s:12:"post_content";s:5140:"I've been a fan of <span class="blsp-spelling-error" id="SPELLING_ERROR_0">Photoshop</span> but lacked <span class="blsp-spelling-error" id="SPELLING_ERROR_1">intersting</span> pics (there's only so much you can do with family photo's). So I picked up my <a href="http://www.amazon.com/review/R2CAPH6Q5CVBQZ">hp <span class="blsp-spelling-error" id="SPELLING_ERROR_2">photosmart</span> 435</a> piece of crap and decided to go outside and take some pics. Here is the outcome of my Amateur Photography;<br /><br /><div style="text-align: center;"><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://2.bp.blogspot.com/_QnxE8XBPT48/R1JLNwHm0AI/AAAAAAAAAJc/6fh76QUKU5o/s1600-R/pictures+004.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 282px; height: 219px;" src="http://2.bp.blogspot.com/_QnxE8XBPT48/R1JLNwHm0AI/AAAAAAAAAJc/Bu2_eVfVemA/s400/pictures+004.jpg" alt="" id="BLOGGER_PHOTO_ID_5139252824410345474" border="0" /></a>Here is my camera on night view. It kind of reminds me of the <span class="blsp-spelling-error" id="SPELLING_ERROR_3">Perris</span> Hilton sex tape.<br /><br /><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://1.bp.blogspot.com/_QnxE8XBPT48/R1JLvgHm0BI/AAAAAAAAAJk/PWFipHLEQ-M/s1600-R/pictures+005.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 286px; height: 225px;" src="http://1.bp.blogspot.com/_QnxE8XBPT48/R1JLvgHm0BI/AAAAAAAAAJk/H6uQx9xLaXM/s400/pictures+005.jpg" alt="" id="BLOGGER_PHOTO_ID_5139253404230930450" border="0" /></a>I turned the night view off and decided to use the normal flash feature. I have no clue what that light is, but I'm thinking aliens.<br /><br /><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://4.bp.blogspot.com/_QnxE8XBPT48/R1JNRQHm0CI/AAAAAAAAAJs/Y0_8Q_f84Bk/s1600-R/pictures+008.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 297px; height: 223px;" src="http://4.bp.blogspot.com/_QnxE8XBPT48/R1JNRQHm0CI/AAAAAAAAAJs/loEQgtymhmE/s400/pictures+008.jpg" alt="" id="BLOGGER_PHOTO_ID_5139255083563143202" border="0" /></a><br /></div>Since I'm a glutton for punishment I decided to try out the night view feature again.<br /><br /><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://3.bp.blogspot.com/_QnxE8XBPT48/R1JNSAHm0DI/AAAAAAAAAJ0/4yFLyrhZAcM/s1600-R/pictures+007.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 315px; height: 236px;" src="http://3.bp.blogspot.com/_QnxE8XBPT48/R1JNSAHm0DI/AAAAAAAAAJ0/8XErDOJ420o/s400/pictures+007.jpg" alt="" id="BLOGGER_PHOTO_ID_5139255096448045106" border="0" /></a><br />Same pic minus the night view (or make your picture green) effect. Well.... my pics look like crap with or without the effect. If you thought that was all of the punishment I was going to put you through you thought wrong. <span class="blsp-spelling-error" id="SPELLING_ERROR_4">Hahaha</span>, ha.<br /><br /><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://4.bp.blogspot.com/_QnxE8XBPT48/R1JNSQHm0EI/AAAAAAAAAJ8/-9e9WZOasAw/s1600-R/pictures+011.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 319px; height: 265px;" src="http://4.bp.blogspot.com/_QnxE8XBPT48/R1JNSQHm0EI/AAAAAAAAAJ8/T-Kq2xXGL3k/s400/pictures+011.jpg" alt="" id="BLOGGER_PHOTO_ID_5139255100743012418" border="0" /></a><br />It took some serious skills <strikethrough>(Beer)</strikethrough>  to get this picture of a tree to look like this.<br /><br /><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://1.bp.blogspot.com/_QnxE8XBPT48/R1JNSgHm0FI/AAAAAAAAAKE/HoECcbYvscY/s1600-R/pictures+012.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 320px; height: 240px;" src="http://1.bp.blogspot.com/_QnxE8XBPT48/R1JNSgHm0FI/AAAAAAAAAKE/izJSkzibxYU/s400/pictures+012.jpg" alt="" id="BLOGGER_PHOTO_ID_5139255105037979730" border="0" /></a><br /><div style="text-align: center;"><span class="blsp-spelling-error" id="SPELLING_ERROR_5">Ahhh</span>! The Aliens are back!<br /><br /><a onblur="try {parent.deselectBloggerImageGracefully();} catch(e) {}" href="http://3.bp.blogspot.com/_QnxE8XBPT48/R1JNTAHm0GI/AAAAAAAAAKM/MzP-n1Eo1QA/s1600-R/pictures+013.jpg"><img style="margin: 0px auto 10px; display: block; text-align: center; cursor: pointer; width: 326px; height: 229px;" src="http://3.bp.blogspot.com/_QnxE8XBPT48/R1JNTAHm0GI/AAAAAAAAAKM/Z-TjM6W2RGk/s400/pictures+013.jpg" alt="" id="BLOGGER_PHOTO_ID_5139255113627914338" border="0" /></a>Last but certainly not least, this is the result of leaving the camera on while you pass out from drinking too much Schlitz Malt Liquor.<br /><br /><div style="text-align: left;">Since I enjoyed my first photos I think I'll keep it up. I never thought I would have so much fun drinking and shooting (photos). Try to arrest me for that!<br /></div></div>";s:10:"post_title";s:26:"My First go at Photography";s:12:"post_excerpt";s:0:"";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:6:"closed";s:11:"ping_status";s:4:"open";s:13:"post_password";s:0:"";s:9:"post_name";s:26:"my-first-go-at-photography";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2013-04-25 04:39:16";s:17:"post_modified_gmt";s:19:"2013-04-25 04:39:16";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";s:1:"0";s:4:"guid";s:28:"http://bryansiegel.com/?p=10";s:10:"menu_order";s:1:"0";s:9:"post_type";s:4:"post";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";}}